var json_name = "SMPL_config.json";
var blendstarted = false;
var animating = false;

function containme( container_tag, container_height, container_width, camera_fov, camera_near, camera_far, camera_x, camera_y, camera_z, lights_hex, lights_intensity, lights_x, lights_y, lights_z, lights_h, lights_s, lights_l, json_config, json_character ) {


	var SCREEN_WIDTH = container_width;
	var SCREEN_HEIGHT = container_height;

	var container = container_tag;

	this.renderer;	
	this.camera;
	this.scene;
	this.mesh = null;
	this.character = null;
	this.controls;


	var mouseX = 0, mouseY = 0;

	var json_name = json_config;

	/*var windowHalfX = window.innerWidth / 2;
	var windowHalfY = window.innerHeight / 2;*/


	var windowHalfX = container_width / 2;
	var windowHalfY = container_height / 2;

	var clock = new THREE.Clock();

	this.test2 = "jojojo2";
	
	//var gui, skinConfig, morphConfig;
		
	document.addEventListener( 'mousemove', onDocumentMouseMove, false );



	createScene();
	//init(json_character);
	animate();

	function createScene() {

		
		camera = new THREE.PerspectiveCamera( camera_fov, SCREEN_WIDTH / SCREEN_HEIGHT, camera_near, camera_far );
		camera.position.set( camera_x, camera_y, camera_z );
		
		scene = new THREE.Scene();

		// FLOOR?

		/*var floorgeom = new THREE.PlaneBufferGeometry( 500000, 500000, 1, 1 );
		var floormat = new THREE.MeshBasicMaterial( { color: 0xCCEBFF, transparent: true, opacity: 0.3 } );
		var floor = new THREE.Mesh( floorgeom, floormat );
		floor.material.side = THREE.DoubleSide;
		floor.rotateX (Math.PI / 2);
		floor.position.set(0, -2490,0)
		scene.add( floor );*/

		// LIGHTS


		var ambient = new THREE.AmbientLight( 0xE9E9E9);
        scene.add( ambient );

		var light = new THREE.DirectionalLight( lights_hex, lights_intensity );
		light.position.set( lights_x, lights_y, lights_z );
		light.position.multiplyScalar( 1.1 );
		//light.color.setHSL( lights_h, lights_s, lights_l );
		scene.add( light );

		var light = new THREE.DirectionalLight( 0xffffff, 1 );
        light.position.set( 0, 2000, 0 );
        //scene.add( light );
		//

		var light = new THREE.DirectionalLight( 0xffffff, 1 );
		light.position.set( 10, 100, -500 );
		scene.add( light );

		// RENDERER

		renderer = new THREE.WebGLRenderer( { antialias: true } );
		renderer.setClearColor( 0xffffff );
		renderer.setPixelRatio( window.devicePixelRatio );
		renderer.setSize( SCREEN_WIDTH, SCREEN_HEIGHT );
		container.appendChild( renderer.domElement );

		character = null;

		window.addEventListener( 'resize', onWindowResize, false );
	
		controls = new THREE.OrbitControls( camera, renderer.domElement );
		//controls.center.set( 0, 3000, 0);
		controls.center.set( 0, 0, 0);

		controls.addEventListener( 'change', render );

		
	}


	function setCharacter(charac) {

		this.character = charac;
		console.log (charac);
	}


	function onWindowResize() {

		windowHalfX = SCREEN_WIDTH / 2;
		windowHalfY = SCREEN_HEIGHT / 2;

		camera.aspect = SCREEN_WIDTH / SCREEN_HEIGHT;
		camera.updateProjectionMatrix();

		renderer.setSize( SCREEN_WIDTH, SCREEN_HEIGHT );

	}

	function onDocumentMouseMove( event ) {

		mouseX = ( event.clientX - windowHalfX ) * 10;
		mouseY = ( event.clientY - windowHalfY ) * 10;

	}

	//

	function animate() {

		requestAnimationFrame( animate );
		render();

	}

	function render() {

		var delta = 0.75 * clock.getDelta();

		// update skinning

		THREE.AnimationHandler.update( delta );
		renderer.render( scene, camera );

	}


}


containme.prototype.displayMesh = function (sex) {

	

	blendstarted = true;
	animating = false;

	//this.character = new THREE.SMPLCharacter();
	oldChar = scene.remove(scene.children[scene.children.length-1]);

	var loader = new THREE.JSONLoader();
	var path = "assets/" + sex;
	console.log(path);


    loader.load(path, function ( geometry, materials ) {

    	geometry.computeBoundingBox();
		geometry.computeVertexNormals();

		basicbody = geometry;
		
		mesh = new THREE.Mesh( basicbody, new THREE.MeshNormalMaterial({morphTargets: true, color: 0xff0000}) );

		var bb = basicbody.boundingBox;
		mesh.scale.set(3000, 3000, 3000);
		mesh.position.set( 0, -3000, 0);

		mesh.castShadow = true;
		mesh.receiveShadow = true;

       
		scene.add( mesh );

		//console.log('print after scene.add');
		$('div.midoverlay').hide();

    } );

    //console.log('print after loader');


}

containme.prototype.updateMesh = function(blendshape, value) {

	if(blendstarted)
		mesh.morphTargetInfluences[blendshape] = value;

}

containme.prototype.turnflagoff = function(){

	blendstarted = false;
}


